const { ipcRenderer } = require('electron');
function addRotationButton() {
    if (document.getElementById('RotationButton')) return;

    var muteBtn = document.querySelector(`div[data-title=静音]`);
    // console.log(muteBtn)
    let { left, top } = muteBtn.style;
    left = left.replace('px', '')
    top = top.replace('px', '')
    // console.log(left, top)
    var imageBtn = document.createElement('img')
    imageBtn.id = 'RotationButton';
    //#region
    imageBtn.src = `data:image/png;base64,`;
    //#endregion

    imageBtn.style.position = 'absolute';
    imageBtn.style.cursor = 'pointer';
    imageBtn.style.width = '38px';
    imageBtn.style.height = '38px';
    imageBtn.style.left = `${left - 50}px`;
    imageBtn.style.top = '14px';
    imageBtn.style.zIndex = 2;

    imageBtn.addEventListener('click', rotateVideo)
    muteBtn.parentElement.appendChild(imageBtn);
}

function rotateVideo() {
    if (player) {
        rotation += 90;
        if (rotation >= 360) rotation = 0;
        player.videoRotation(rotation)
    }
}
window.onresize = (e) => {
    var muteBtn = document.querySelector(`div[data-title=静音]`);
    var imageBtn = document.getElementById('RotationButton');
    left = muteBtn.style.left.replace('px', '')
    imageBtn.style.left = `${left - 50}px`;
}

var player;
var rotation = 0;

function getParameterByName(url, name) {
    name = name.replace(/[\[]/, '\\\[').replace(/[\]]/, '\\\]');
    var regex = new RegExp('[\\?&]' + name + '=([^&#]*)'),
        results = regex.exec(url);
    return results === null ? '' : decodeURIComponent(results[1].replace(/\+/g, ' '));
}

ipcRenderer.on('message', (_, { platform, playsrc, title, isTop }) => {
    document.querySelector('.header .title').innerText = title;

    if (platform && platform == "darwin") {
        // document.querySelector('.header.player').style.display = "none";
        document.querySelector('.header .title').innerText = '';
    } else if (platform && platform == "win32") {
    }

    if(isTop){
        document.querySelector('.heisir .header .pin').classList.add('active')
    }else{
        document.querySelector('.heisir .header .pin').classList.remove('active')
    }

    if (playsrc) {
        // document.title = '';
        rotation = 0;
        var videoObject = {
            container: '#player', //容器的ID或className
            variable: 'player', //播放函数名称
            //loop: true, //播放结束是否循环播放
            autoplay: true,//是否自动播放,
            video: playsrc
        };
        if (player) {
            player.VA[0][0] = playsrc;
            rotation = 0;
            player.videoRotation(rotation)
            player.changeVideo();
        } else {
            player = new ckplayer(videoObject);
        }
        setTimeout(() => {
            document.querySelectorAll('img')[1].style.display = 'none';
            addRotationButton();
        }, 100);
    }
});
var btnClose = document.querySelector('.heisir .header .close');
btnClose.onclick = function () {
    window.close();
};

var btnOpenVideo = document.querySelector('.heisir .header .open');
btnOpenVideo.onclick = function () {
    ipcRenderer.send('player-open-video');
};

document.querySelector('.heisir .header .pin')
    .onclick = function (e) {
        let btn = e.target;
        btn.classList.toggle("active");
        // console.log(e.target.classList, btn.classList?.contains('active'))
        ipcRenderer.send('player-pin-on-top', btn.classList?.contains('active'));
    };